// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/// @title Decentralized Voting System
/// @notice Supports multiple elections, candidate registration, voting, and results
contract DVS {
    address public owner;
    uint256 public electionCount;

    enum Phase { Registration, Voting, Ended }

    struct Candidate {
        uint256 id;
        string name;
        uint256 voteCount;
    }

    struct Election {
        uint256 id;
        string name;
        string description;
        uint256 startTime;
        uint256 endTime;
        Phase phase;
        uint256 candidateCount;
        mapping(uint256 => Candidate) candidates;
        uint256[] candidateIds;
        mapping(address => bool) hasVoted;
        bool exists;
    }

    mapping(uint256 => Election) private elections;

    // Events
    event ElectionCreated(uint256 indexed electionId, string name);
    event CandidateAdded(uint256 indexed electionId, uint256 indexed candidateId, string name);
    event Voted(uint256 indexed electionId, address indexed voter, uint256 indexed candidateId);
    event PhaseAdvanced(uint256 indexed electionId, Phase newPhase);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner");
        _;
    }

    modifier electionExists(uint256 _electionId) {
        require(elections[_electionId].exists, "Election does not exist");
        _;
    }

    modifier inPhase(uint256 _electionId, Phase _phase) {
        require(elections[_electionId].phase == _phase, "Invalid phase for this action");
        _;
    }

    constructor() {
        owner = msg.sender;
        electionCount = 0;
    }

    /// @notice Create a new election
    function createElection(
        string calldata _name,
        string calldata _description,
        uint256 _startTime,
        uint256 _endTime
    ) external onlyOwner returns (uint256) {
        require(_startTime < _endTime, "Start must be before end");

        uint256 id = electionCount;
        Election storage e = elections[id];
        e.id = id;
        e.name = _name;
        e.description = _description;
        e.startTime = _startTime;
        e.endTime = _endTime;
        e.phase = Phase.Registration;
        e.candidateCount = 0;
        e.exists = true;

        electionCount++;
        emit ElectionCreated(id, _name);
        return id;
    }

    /// @notice Fetch all elections
    function getAllElections()
        external
        view
        returns (uint256[] memory ids, string[] memory names, uint256[] memory phases)
    {
        ids = new uint256[](electionCount);
        names = new string[](electionCount);
        phases = new uint256[](electionCount);

        for (uint256 i = 0; i < electionCount; i++) {
            Election storage e = elections[i];
            ids[i] = e.id;
            names[i] = e.name;
            phases[i] = uint256(e.phase);
        }
    }

    /// @notice Add candidate to an election
    function addCandidate(uint256 _electionId, string calldata _name)
        external
        onlyOwner
        electionExists(_electionId)
        inPhase(_electionId, Phase.Registration)
    {
        Election storage e = elections[_electionId];
        uint256 id = e.candidateCount;
        e.candidates[id] = Candidate({id: id, name: _name, voteCount: 0});
        e.candidateIds.push(id);
        e.candidateCount++;

        emit CandidateAdded(_electionId, id, _name);
    }

    /// @notice Advance election phase
    function advancePhase(uint256 _electionId)
        external
        onlyOwner
        electionExists(_electionId)
    {
        Election storage e = elections[_electionId];
        if (e.phase == Phase.Registration) {
            require(e.candidateCount > 0, "Need at least 1 candidate");
            e.phase = Phase.Voting;
        } else if (e.phase == Phase.Voting) {
            e.phase = Phase.Ended;
        } else {
            revert("Election already ended");
        }
        emit PhaseAdvanced(_electionId, e.phase);
    }

    /// @notice Cast vote for a candidate
    function vote(uint256 _electionId, uint256 _candidateId)
        external
        electionExists(_electionId)
        inPhase(_electionId, Phase.Voting)
    {
        Election storage e = elections[_electionId];
        require(!e.hasVoted[msg.sender], "Already voted");
        require(_candidateId < e.candidateCount, "Invalid candidate");

        e.hasVoted[msg.sender] = true;
        e.candidates[_candidateId].voteCount++;

        emit Voted(_electionId, msg.sender, _candidateId);
    }

    /// @notice Get all candidates of an election
    function getCandidates(uint256 _electionId)
        external
        view
        electionExists(_electionId)
        returns (uint256[] memory ids, string[] memory names, uint256[] memory votes)
    {
        Election storage e = elections[_electionId];
        uint256 len = e.candidateIds.length;

        ids = new uint256[](len);
        names = new string[](len);
        votes = new uint256[](len);

        for (uint256 i = 0; i < len; i++) {
            uint256 cid = e.candidateIds[i];
            Candidate storage c = e.candidates[cid];
            ids[i] = c.id;
            names[i] = c.name;
            votes[i] = c.voteCount;
        }
    }

    /// @notice Get winners of an election
    function getWinners(uint256 _electionId)
        external
        view
        electionExists(_electionId)
        returns (uint256[] memory)
    {
        Election storage e = elections[_electionId];
        require(e.candidateCount > 0, "No candidates");

        uint256 maxVotes = 0;
        for (uint256 i = 0; i < e.candidateIds.length; i++) {
            uint256 cid = e.candidateIds[i];
            if (e.candidates[cid].voteCount > maxVotes) {
                maxVotes = e.candidates[cid].voteCount;
            }
        }

        uint256 winnerCount = 0;
        for (uint256 i = 0; i < e.candidateIds.length; i++) {
            if (e.candidates[e.candidateIds[i]].voteCount == maxVotes) {
                winnerCount++;
            }
        }

        uint256[] memory winners = new uint256[](winnerCount);
        uint256 idx = 0;
        for (uint256 i = 0; i < e.candidateIds.length; i++) {
            if (e.candidates[e.candidateIds[i]].voteCount == maxVotes) {
                winners[idx] = e.candidateIds[i];
                idx++;
            }
        }

        return winners;
    }
}
